import axios from 'axios'
import { API } from '../commons'

const Home = () => {
  return <div>Home</div>
}

Home.getInitialProps = async () => {
  try {
    const  { data } =  await axios.get(API.BASE.characters)
    return { data }
  } catch (error) {
    console.log(error)
  }
}

export default Home
